import React from 'react'
import Input from '../Input/Input'
import './Modal.css'

function Modal(props) {
    return (
        <section>
            <h2>{props.h2}</h2>
            <Input
                    htmlFor={props.htmlFor}
                    id={props.id}
                    type={props.type}
                    name={props.name}>
                    {props.children}
            </Input>
        </section>
    )
}
export default Modal
